import React from "react";
import Menu from "../Menu/Menu";
import styles from "./styles.module.css";
import logo from "../../img/logo.png";

function Header() {
  return (
    <div className="header_wrap">
      <div>
        <img src={logo} alt="" />
      </div>
      <div>
        <Menu />
      </div>
    </div>
  );
}

export default Header;
